import React from "react";
import { Nav, Navbar, Button } from 'react-bootstrap';


function Header() {
  return (
    <header className="header">
    <Navbar style={{backgroundColor: "red"}}fixed="top" variant="dark">
      <Navbar.Brand href="#home">NNN</Navbar.Brand>
      <Nav className="mr-auto">
        <Nav.Link href="#home">What is this?</Nav.Link>
        <Nav.Link href="#features">NNN Rules</Nav.Link>
        <Button variant="outline-info">Search</Button>
      </Nav>
    </Navbar>
  </header>
  );
}

export default Header;
